import React from 'react'
import { useSelector } from 'react-redux'
import Plants from './Plants'

export const PlantsList = () => {
  const plants = useSelector(state => state.plants)

  const renderedPlants = plants.map(plant => (
      <Plants plant = {plant} />
  ))

  return (
    <section>
      <h2>Plants</h2>
      {renderedPlants}
    </section>
  )
}
